n = 105  # qubits

# Build circuit directly based on stabilizer structure
# The state seems to be a CSS-like code with X and Z type stabilizers

circuit_lines = []

# Start with all qubits in |0> state
# To get X-type stabilizers, we need superposition - use H gates

# Looking at the structure:
# - First 15 stabilizers: XXXX at positions 0,1,2,3 then 7,8,9,10 etc (stride 7)
# - Next 15: XIXIXIXI at positions 0,2,4,6 then 7,9,11,13 etc 
# - Next 15: IIXXXX at positions 2,3,4,5 then 9,10,11,12 etc (shifted by 2)
# - Z-type stabilizers follow similar pattern

# For a CSS code, we can:
# 1. Apply H to qubits involved in X-checks
# 2. Apply CNOT gates based on the check structure

# Let me try a simpler approach: use the GHZ-like construction
# But this is complex. Let me use a more systematic approach.

# Build the circuit using standard stabilizer preparation:
# For each X stabilizer, we need a superposition
# For Z stabilizers on |+> states, they're automatically satisfied if structured correctly

# Actually, let me try: Put H on all qubits, then use CZ for Z-stabilizers

# Simpler approach: Build it step by step
# 1. For X-type stabilizers like XXXX on qubits 0,1,2,3: H 0, CNOT 0 1, CNOT 0 2, CNOT 0 3
# 2. For Z-type stabilizers, they should commute if we do this right

# Let me try a graph state approach
# Apply H to all qubits first
for i in range(n):
    circuit_lines.append(f"H {i}")

# For Z stabilizers (ZZZZ type), after H they become XXXX, 
# which is satisfied by creating GHZ-like entanglement
# Use CZ gates based on the Z stabilizer structure

# Z stabilizers at positions:
# 0,1,2,3 -> CZ 0 1, CZ 0 2, CZ 0 3
# 7,8,9,10 -> CZ 7 8, CZ 7 9, CZ 7 10
# etc.

# First set of Z stabilizers (ZZZZ at stride 7)
for block in range(15):
    start = block * 7
    if start + 3 < n:
        circuit_lines.append(f"CZ {start} {start+1}")
        circuit_lines.append(f"CZ {start} {start+2}")
        circuit_lines.append(f"CZ {start} {start+3}")

# Second set of Z stabilizers (ZIZIZI at stride 7)
for block in range(15):
    start = block * 7
    if start + 6 < n:
        circuit_lines.append(f"CZ {start} {start+2}")
        circuit_lines.append(f"CZ {start} {start+4}")
        circuit_lines.append(f"CZ {start} {start+6}")

# Third set of Z stabilizers (IIZZZZ at positions 2-5, stride 7)
for block in range(15):
    start = block * 7 + 2
    if start + 3 < n:
        circuit_lines.append(f"CZ {start} {start+1}")
        circuit_lines.append(f"CZ {start} {start+2}")
        circuit_lines.append(f"CZ {start} {start+3}")

circuit_text = "\n".join(circuit_lines)
print(circuit_text)
